#!/usr/bin/python
#
# Sort a linked list in O(n log n) time using constant space complexity.
#
# Definition for singly-linked list.
# class ListNode:
#     def __init__(self, x):
#         self.val = x
#         self.next = None

class Solution:

    # @param head, a ListNode
    # @return a ListNode
    def sortList(self, head):
        if not head or not head.next:
            return head

        def mergeTwoLists(l1, l2):
            if not l1:
                return l2
            elif not l2:
                return l1
            h=None
            ptr=None
            h1=l1
            h2=l2
            while True:
                if h1.val <= h2.val:
                    if h:
                        ptr.next=h1
                    else:
                        h=h1
                    ptr=h1
                    h1=h1.next
                    if not h1:
                        ptr.next=h2
                        return h
                else:
                    if h:
                        ptr.next=h2
                    else:
                        h=h2
                    ptr=h2
                    h2=h2.next
                    if not h2:
                        ptr.next=h1
                        return h

        def recursiveMergeSort(ptr, length):
            if length == 1:
                return ptr
            iter_elem=None
            for i in xrange(0, length/2):
                if iter_elem:
                    iter_elem=iter_elem.next
                else:
                    iter_elem=ptr
            l2=iter_elem.next
            iter_elem.next=None
            return mergeTwoLists(recursiveMergeSort(ptr, length/2), recursiveMergeSort(l2, length-length/2))

        count=0        
        now=head
        while now:
            now=now.next
            count+=1

        return recursiveMergeSort(head, count)

